fragment:
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:odor rdfs:subClassOf :physical_quality ;
    :has_definition "A physical quality inhering in a bearer by virtue of the bearer's molecules being are aerially dispersed and perceived by an odorant receptor." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spatial_pattern rdfs:subClassOf :morphology ;
    :has_definition "A spatial quality inhering in a bearer by virtue of the bearer's exhibiting repetition of placement of its parts." ;
    :has_exact_synonym "distribution" ;
    :has_related_synonym "pattern" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:deviation_from_normal_ rdfs:subClassOf :qualitative ;
    :has_definition "A quality inhering in a bearer by virtue of the whether the bearer differs from normal or average." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amount rdfs:subClassOf :qualitative ;
    :has_definition "The number of entities of this type that are part of the whole organism." ;
    :has_exact_synonym "presence or absence in organism",
        "quantitative" ;
    :has_related_synonym "count in organism",
        "number",
        "presence" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amplitude rdfs:subClassOf :physical_quality_of_a_process ;
    :has_definition "A physical quality of a process inhering in a bearer by virtue of the size of the bearer's maximum displacement from the 'normal' position, when periodic motion is taking place." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sensitivity_toward rdfs:subClassOf :organismal_quality ;
    :has_definition "A quality inhering in a bearer by virtue of the bearer's disposition to detect or perceive external stimulation." ;
    :has_exact_synonym "sensitivity" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:size rdfs:subClassOf :morphology ;
    :has_definition "A morphology quality inhering in a bearer by virtue of the bearer's physical magnitude." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:length rdfs:subClassOf :1_d_extent ;
    :has_definition "A 1-D extent quality which is equal to the distance between two points." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mass rdfs:subClassOf :physical_quality ;
    :has_definition "A physical quality that inheres in a bearer by virtue of the proportion of the bearer's amount of matter." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:closure rdfs:subClassOf :morphology ;
    :has_definition "A morphological quality pertaining to the degree to which an object contains an opening, aperture, orifice or vent." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:position rdfs:subClassOf :physical_quality ;
    :has_definition "A spatial quality inhering in a bearer by virtue of the bearer's spatial location relative to other objects in the vicinity." ;
    :has_exact_synonym "location",
        "placement",
        "relational spatial quality" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:structure rdfs:subClassOf :morphology ;
    :has_broad_synonym "conformation" ;
    :has_definition "A morphology quality inhering in a bearer by virtue of the bearer's relative position, shape, arrangements and connectivity of an organism's various parts; the pattern underlying its form." ;
    :has_exact_synonym "relational structural quality" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:temperature rdfs:subClassOf :physical_quality ;
    :has_definition "A physical quality of the thermal energy of a system." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:texture rdfs:subClassOf :morphology ;
    :has_definition "A morphologic quality inhering in a bearer by virtue of the bearer's relative size, organization and distribution of its surface elements or the representation or invention of the appearance of its surface; visual and tactile surface characteristics." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rate rdfs:subClassOf :physical_quality_of_a_process ;
    :has_definition "A quality of a single process inhering in a bearer by virtue of the bearer's occurrence per unit time." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:time rdfs:subClassOf :physical_quality ;
    :has_definition "A quality in which events occur in sequence." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:viability rdfs:subClassOf :organismal_quality ;
    :has_definition "An organismal quality inhering in a bearer or a population by virtue of the bearer's disposition to survive and develop normally or the number of surviving individuals in a given population." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:increased_speed rdfs:subClassOf :increased_object_quality,
        :speed ;
    :has_definition "A speed which is relatively high." ;
    :has_exact_synonym "high speed" ;
    :has_related_synonym "fast speed" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:decreased_speed rdfs:subClassOf :decreased_object_quality,
        :speed ;
    :has_definition "A speed which is relatively low." ;
    :has_exact_synonym "slow",
        "slow speed" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:old rdfs:subClassOf :age ;
    :has_definition "An age which is relatively high." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:young rdfs:subClassOf :age ;
    :has_definition "An age which is relatively low." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blue rdfs:subClassOf :color ;
    :has_definition "A color hue with low wavelength of that portion of the visible spectrum lying between green and indigo, evoked in the human observer by radiant energy with wavelengths of approximately 420 to 490 nanometers." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:white rdfs:subClassOf :color ;
    :has_definition "An achromatic color of maximum brightness; the color of objects that reflect nearly all light of all visible wavelengths." ;
    :has_related_synonym "whitish" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:irregular_spatial_pattern rdfs:subClassOf :spatial_pattern ;
    :has_definition "A spatial pattern inhering in a bearer by virtue of the bearer's magnitude of or the relationships between its repeated parts lack consistency." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:colorless rdfs:subClassOf :color_pattern ;
    :has_definition "A color quality inhering in a bearer by virtue of the bearer's lacking color." ;
    :has_related_synonym "unpigmented" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:down rdfs:subClassOf :direction ;
    :has_definition "A directional quality inhering in a bearer by virtue of the bearer's direction from a higher to a lower point." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:left rdfs:subClassOf :direction ;
    :has_definition "A directional quality inhering in a bearer by virtue of the bearer's direction that is similar to the direction of an object to the north when it faces east." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:right rdfs:subClassOf :direction ;
    :has_definition "A directional quality inhering in a bearer by virtue of the bearer's direction that is similar to the direction of an object to the north when it faces west." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:up rdfs:subClassOf :direction ;
    :has_definition "A directional quality inhering in a bearer by virtue of the bearer's direction from a lower to a higher point." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:increased_frequency rdfs:subClassOf :frequency,
        :increased_rate_of_occurrence ;
    :has_definition "A frequency which is relatively high." ;
    :has_exact_synonym "high frequency" ;
    :has_related_synonym "frequent" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:decreased_frequency rdfs:subClassOf :decreased_rate_of_occurrence,
        :frequency ;
    :has_definition "A frequency which is relatively low." ;
    :has_exact_synonym "low frequency" ;
    :has_related_synonym "infrequent" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hard rdfs:subClassOf :hardness,
        :increased_object_quality ;
    :has_definition "A hardness quality of being rigid and resistant to pressure." ;
    :has_related_synonym "firm",
        "impenetrable",
        "tough" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:branched rdfs:subClassOf :branchiness ;
    :has_definition "A branchiness quality inhering in a bearer by virtue of the bearer's having branches." ;
    :has_exact_synonym "ramified",
        "ramiform" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:coiled rdfs:subClassOf :coiling ;
    :has_definition "A shape quality inhering in a bearer by virtue of the bearer's being curled or wound (especially in concentric rings or spirals)." ;
    :has_exact_synonym "spiral" ;
    :has_related_synonym "helical",
        "helicoid",
        "helicoidal",
        "helix-shaped" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:curled rdfs:subClassOf :shape ;
    :has_definition "A shape quality inhering in a bearer by virtue of the bearer's having parallel chains in undulate fashion on the border." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:curved rdfs:subClassOf :curvature ;
    :has_definition "A curvature quality inhering in a bearer by virtue of the bearer's having or being marked by a curve or smoothly rounded bend." ;
    :has_narrow_synonym "bowing" ;
    :has_related_synonym "curled" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:flat rdfs:subClassOf :flattened ;
    :has_definition "A quality inhering in a bearer by virtue of the bearer's having a horizontal surface without a slope, tilt, or curvature." ;
    :has_related_synonym "plate-like" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:circular rdfs:subClassOf :elliptic ;
    :has_definition "A shape quality inhering in a bearer by virtue of the bearer's being such that every part of the surface or the circumference is equidistant from the center." ;
    :has_related_synonym "round",
        "rounded" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sporadic rdfs:subClassOf :occurrence ;
    :has_definition "A quality of a single process inhering in a bearer by virtue of the bearer's once or in or a few unpredictable instances." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:invariant rdfs:subClassOf :variability ;
    :has_definition "A variability quality inhering in a bearer by virtue of the bearer's lacking or not exhibiting variation." ;
    :has_exact_synonym "uniform" ;
    :has_related_synonym "constant" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:regular_spatial_pattern rdfs:subClassOf :spatial_pattern ;
    :has_definition "A pattern quality inhering in a bearer by virtue of the bearer's having a repeatable or predictable placement." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:present rdfs:subClassOf :amount ;
    :has_definition "A quality inhering in a bearer by virtue of the bearer's existence." ;
    :has_related_synonym "present in organism" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:increased_length rdfs:subClassOf :increased_size,
        :length ;
    :has_definition "A length quality which is relatively large." ;
    :has_exact_synonym "long" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:decreased_length rdfs:subClassOf :decreased_size,
        :length ;
    :has_definition "A length quality which is relatively small." ;
    :has_exact_synonym "short" ;
    :has_related_synonym "shortened",
        "stubby" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:increased_size rdfs:subClassOf :increased_object_quality,
        :size ;
    :has_definition "A size quality which is relatively high." ;
    :has_related_synonym "big",
        "enlarged",
        "expanded",
        "great",
        "large" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:decreased_size rdfs:subClassOf :decreased_object_quality,
        :size ;
    :has_definition "A size quality which is relatively low." ;
    :has_narrow_synonym "hypoplasia",
        "underdeveloped" ;
    :has_related_synonym "reduced",
        "small",
        "tiny" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:increased_thickness rdfs:subClassOf :increased_size,
        :thickness ;
    :has_definition "A thickness which is relatively high." ;
    :has_exact_synonym "high thickness",
        "stout",
        "thickened" ;
    :has_related_synonym "thick" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:decreased_thickness rdfs:subClassOf :decreased_size,
        :thickness ;
    :has_definition "A thickness which is relatively low." ;
    :has_exact_synonym "low thickness" ;
    :has_related_synonym "slender",
        "thin" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:increased_volume rdfs:subClassOf :increased_size,
        :volume ;
    :has_definition "A volume which is relatively high." ;
    :has_exact_synonym "high volume" ;
    :has_related_synonym "large volume" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:decreased_volume rdfs:subClassOf :decreased_size,
        :volume ;
    :has_definition "A volume which is relatively low." ;
    :has_exact_synonym "low volume" ;
    :has_related_synonym "small volume" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:decreased_width rdfs:subClassOf :decreased_size,
        :width ;
    :has_definition "A width which is relatively small." ;
    :has_related_synonym "narrow" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:increased_width rdfs:subClassOf :increased_size,
        :width ;
    :has_definition "A width which is relatively large." ;
    :has_related_synonym "broad",
        "wide",
        "wide/broad" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:closed rdfs:subClassOf :closure ;
    owl:disjointWith :open ;
    :has_definition "A morphological quality inhering in a bearer by virtue of the bearer's affording blocked passage or view." ;
    :has_related_synonym "blocked" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:closure_incomplete rdfs:subClassOf :open ;
    :has_definition "A morphological quality inhering in a bearer by virtue of the bearer's affording not completed blocked passage or view." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:open rdfs:subClassOf :closure ;
    :has_definition "A morphological quality inhering in a bearer by virtue of the bearer's affording unobstructed passage or view." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bilateral rdfs:subClassOf :position ;
    :has_definition "A positional quality inhering in a bearer by virtue of the bearer's having two sides; two-sided." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:crowded rdfs:subClassOf :position ;
    :has_definition "A positional quality inhering in a bearer by virtue of the bearer's being overfilled." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:erect rdfs:subClassOf :position ;
    :has_definition "A positional quality inhering in a bearer by virtue of the bearer's being upright in position or posture." ;
    :has_exact_synonym "upright" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:misrouted rdfs:subClassOf :position ;
    :has_definition "A positional quality inhering in a bearer by virtue of the bearer's having mistakenly taken course, way, or passage; ill-routed." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prostrate rdfs:subClassOf :position ;
    :has_definition "A positional quality inhering in a bearer by virtue of the bearer's being stretched out and lying at full length along the ground." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:unilateral rdfs:subClassOf :spatial_pattern ;
    :has_definition "A spatial pattern inhering in a bearer by virtue of the bearer's involvement of only one part or side." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fused_with rdfs:subClassOf :structure ;
    :has_definition "A structural quality inhering in a bearer by virtue of the bearer's being merged with another entity." ;
    :has_exact_synonym "fused",
        "fused to" ;
    :has_related_synonym "coalesced",
        "joined with",
        "merged with" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:continuous rdfs:subClassOf :occurrence ;
    :has_definition "A quality of a single process inhering in a bearer by virtue of the bearer's being uninterrupted in time, sequence, substance, or extent." ;
    :has_exact_synonym "uninterrupted" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:discontinuous rdfs:subClassOf :occurrence ;
    :has_definition "A quality of a single process inhering in a bearer by virtue of the bearer's being marked by breaks or interruptions." ;
    :has_exact_synonym "interrupted" ;
    :has_related_synonym "intermittent" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:smooth rdfs:subClassOf :texture ;
    :has_definition "A texture quality inhering in a bearer by virtue of the bearer's processing a surface free of roughness or irregularities." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:decreased_rate rdfs:subClassOf :decreased_process_quality,
        :rate ;
    :has_definition "A rate which is relatively low." ;
    :has_exact_synonym "slow rate" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:increased_rate rdfs:subClassOf :increased_process_quality,
        :rate ;
    :has_definition "A rate which is relatively high." ;
    :has_exact_synonym "fast rate",
        "high rate" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thickness rdfs:subClassOf :1_d_extent ;
    :has_definition "A 1-D extent quality which is equal to the dimension through an object as opposed to its length or width." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:volume rdfs:subClassOf :3_d_extent ;
    :has_definition "A 3-D extent quality inhering in a bearer by virtue of the bearer's amount of 3-dimensional space it occupies." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:width rdfs:subClassOf :1_d_extent ;
    :has_definition "A 1-D extent quality which is equal to the distance from one side of an object to another side which is opposite." ;
    :has_related_synonym "breadth" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oblong rdfs:subClassOf :2_d_shape ;
    :has_definition "A shape quality inhering in a bearer by virtue of the bearer's having a somewhat elongated form with approximately parallel sides." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:elliptic rdfs:subClassOf :superelliptic ;
    :has_definition "A spheroid quality inhering in a bearer by virtue of the bearer's being oval with two axes of symmetry, as produced by a conical section." ;
    :has_exact_synonym "ellipse-shaped",
        "ellipsoid",
        "elliptical" ;
    :has_related_synonym "oval",
        "ovoid" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brown rdfs:subClassOf :color ;
    :has_definition "A color consisting of dark orange, red, of very low intensity." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:opacity rdfs:subClassOf :optical_quality ;
    :has_definition "An optical quality which obtains by virtue of the ability of the bearer to absorb visible light." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:opaque rdfs:subClassOf :opacity ;
    :has_definition "A optical quality inhering in a bearer by virtue of the bearer's not being clear; not transmitting or reflecting light or radiant energy." ;
    :has_exact_synonym "non-transparent" ;
    :has_related_synonym "clouding",
        "cloudy" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:transparent rdfs:subClassOf :opacity ;
    :has_definition "A optical quality inhering in a bearer by virtue of the bearer's lacking opacity." ;
    :has_exact_synonym "clear",
        "hyaline" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:undulate rdfs:subClassOf :shape ;
    :has_definition "A shape quality inhering in a bearer by virtue of the bearer's having a sinuate margin and rippled surface." ;
    :has_exact_synonym "undulated",
        "undulating",
        "waved",
        "wavy" ;
    :has_related_synonym "rippled",
        "sinuate" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:permeability rdfs:subClassOf :structure ;
    :has_definition "A structural quality inhering in a bearer by virtue of the bearer's disposition to being permeated or pervaded by a gas or liquid (as by osmosis or diffusion)." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:porosity rdfs:subClassOf :structure ;
    :has_definition "A structure quality inhering in a bearer by virtue of the bearer's disposition to admit the passage of gas or liquid through pores or interstices." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:permeable rdfs:subClassOf :permeability ;
    owl:disjointWith :impermeable ;
    :has_definition "A permeability quality inhering in a bearer by virtue of the bearer's being capable to be permeated or pervaded by a gas or liquid (as by osmosis or diffusion)." ;
    :has_related_synonym "porous" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:impermeable rdfs:subClassOf :permeability ;
    :has_definition "A permeability quality inhering in a bearer by virtue of the bearer's being incapable of being permeated or pervaded by a gas or liquid (as by osmosis or diffusion)." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:porous rdfs:subClassOf :porosity ;
    owl:disjointWith :non_porous ;
    :has_definition "A porosity quality inhering in a bearer by virtue of the bearer's being capable of admitting the passage of gas or liquid through pores or interstices." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:non_porous rdfs:subClassOf :porosity ;
    :has_definition "A porosity quality inhering in a bearer by virtue of the bearer's being incapable of admitting the passage of gas or liquid through pores or interstices." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:viscosity rdfs:subClassOf :quality_of_a_liquid ;
    :has_definition "A physical quality of a fluid inhering in a bearer by virtue of the bearer's disposition to internal resistance to flow." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:viscous rdfs:subClassOf :viscosity ;
    :has_definition "A viscosity quality inhering in a bearer by virtue of the bearer's having viscosity." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:physical_quality rdfs:subClassOf :physical_object_quality ;
    :has_definition "A quality of a physical entity that exists through action of continuants at the physical level of organisation in relation to other entities." ;
    :has_exact_synonym "relational physical quality" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mass_density rdfs:subClassOf :physical_quality ;
    :has_definition "A physical quality which inheres in a bearer by virtue of some influence is exerted by the bearer's mass per unit size." ;
    :has_related_synonym "density" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:momentum rdfs:subClassOf :movement_quality ;
    :has_definition "A physical quality inhering in a bearer by virtue of the bearer's velocity multiplied by its mass." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

