    :has_exact_synonym "cone-shaped" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:increased_area rdfs:subClassOf :area,
        :increased_size ;
    :has_definition "An area which is relatively high." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:decreased_area rdfs:subClassOf :area,
        :decreased_size ;
    :has_definition "An area which is relatively low." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:columnar rdfs:subClassOf :shape ;
    :has_definition "A shape inhering in a bearer by virtue of the bearer's being elongated and cylindrical." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:fenestrated rdfs:subClassOf :structure ;
    :has_definition "A structure quality inhering in a bearer by virtue of the bearer's delimited by a surface with holes." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stratification rdfs:subClassOf :spatial_pattern ;
