        :physical_object_quality ;
    :has_definition "A quality of an object that has a value that is decreased compared to normal or average." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:increased_process_quality rdfs:subClassOf :increased_quality,
        :process_quality ;
    :has_definition "A quality of a process that has a value that is increased compared to normal or average." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:increased_object_quality rdfs:subClassOf :increased_quality,
        :physical_object_quality ;
