:cardinal_direction rdfs:subClassOf :direction ;
    :has_definition "The four cardinal directions or cardinal points are the directions north, east, south, and west, commonly denoted by their initials, N, E, S, W. East and west are at right angles to north and south, with east being in the clockwise direction of rotation from north and west being directly opposite east." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

