    :has_definition "North is one of the four compass points or cardinal directions. It is the opposite of south and is perpendicular to east and west." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:east rdfs:subClassOf :cardinal_direction ;
