    :has_definition "A quality of a substance on which or through which electromagnetic radiation impinges or traverses with respect to radiation. This substance quality changes the quality of the incident radiation with respect to any of: intensity, direction, scatter and wavelength." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:collection_of_organisms rdfs:subClassOf :organismal_entity ;
