                                            owl:onProperty :develops_from ;
                                            owl:someValuesFrom :endoderm ] ;
                                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                                    owl:onProperty :develops_from ;
                                                    owl:someValuesFrom :mesoderm ] ;
                                            rdf:rest :nil ] ] ] ] ] ;
    :has_definition "An anatomical structure that develops from the ectoderm, mesoderm and endoderm." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neuron_projection_bundle rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :nervous_system ],
        :multi_cell_part_structure ;
    :has_definition "A fasciculated bundle of neuron projections (GO:0043005), largely or completely lacking synapses." ;
    :has_exact_synonym "funiculus",
        "nerve fiber bundle",
        "neural fiber bundle" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neural_nucleus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :gray_matter ],
        :caro_0000000,
        :central_nervous_system_cell_part_cluster ;
    :has_broad_synonym "nucleus" ;
    :has_definition "A spatially aggregated collection of nerve cell bodies in the CNS, consisting of one or more subpopulations that share cell type, chemical phenotype, and connections, and including nearby cells that share the same cell type, chemical phenotype, and connections. (CUMBO)." ;
    :has_exact_synonym "nervous system nucleus",
        "neuraxis nucleus",
        "neuronal nucleus",
        "nucleus of CNS" ;
    :has_related_synonym "nucleus of neuraxis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intestine rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :alimentary_part_of_gastrointestinal_system ],
        :subdivision_of_digestive_tract ;
    :has_definition "Segment of the alimentary canal extending from the stomach to the anus and, in humans and other mammals, consists of two segments, the small intestine and the large intestine." ;
    :has_exact_synonym "bowel" ;
    :has_related_synonym "intestinal tract" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:orifice rdfs:subClassOf :anatomical_conduit ;
    :has_broad_synonym "anatomical ostium",
        "ostium" ;
    :has_definition "Anatomical conduit that connects two adjacent body spaces (or a body space with the space surrounding the organism)[FMA,modified]." ;
    :has_exact_synonym "anatomical orifice" ;
    :has_narrow_synonym "hilum" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cloaca rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :digestive_tract ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :genitourinary_system ],
        :subdivision_of_tube ;
    :has_definition "Common chamber into which the intestines and excretory system opens. Arises during development in all vertebrates, but in many it becomes subdivided, lost or incorporated into other structures." ;
    :has_related_synonym "cloacal chamber",
        "vent" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:embryonic_cloaca rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :internal_anal_region ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :renal_system ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :embryo ],
        :cloaca ;
    :has_definition "Endoderm-lined chamber that develops as pouch-like dilation of the caudal end of the hindgut and receives the allantois ventrally and two mesonephric ducts laterally; caudally it ends blindly at the cloacal membrane formed by the union of proctodeal (anal pit) ectoderm and cloacal endoderm, with no intervening mesoderm[MP]." ;
    :has_related_synonym "cloaca" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primitive_urogenital_sinus rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :intermediate_mesoderm ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :embryonic_cloaca ],
        :embryonic_structure ;
    :has_broad_synonym "urogenital sinus" ;
    :has_definition "The ventral part of the cloaca remaining after septation of the rectum, which further develops into part of the bladder, part of the prostatic part of the male urethra and the urethra and vestibule in females." ;
    :has_exact_synonym "UGS",
        "fetal UGS",
        "sinus urogenitalis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mouth rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :head ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :future_mouth ],
        :subdivision_of_digestive_tract ;
    :has_definition "The proximal portion of the digestive tract, containing the oral cavity and bounded by the oral opening. In vertebrates, this extends to the pharynx and includes gums, lips, tongue and parts of the palate. Typically also includes the teeth, except where these occur elsewhere (e.g. pharyngeal jaws) or protrude from the mouth (tusks)." ;
    :has_exact_synonym "regio oralis" ;
    :has_narrow_synonym "adult mouth" ;
    :has_related_synonym "cavital oralis",
        "cavitas oris",
        "cavum oris",
        "mouth cavity",
        "oral region",
        "oral vestibule",
        "rima oris",
        "stoma",
        "stomatodaeum",
        "trophic apparatus",
        "vestibule of mouth",
        "vestibulum oris" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oral_opening rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :mouth ],
        :orifice ;
    :has_definition "The orifice that connects the mouth to the exterior of the body." ;
    :has_exact_synonym "oral fissure",
        "oral orifice" ;
    :has_related_synonym "mouth",
        "oral part of face" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vomit rdfs:subClassOf :regurgitated_substance ;
    :has_definition "A bodily fluid consisting of the expulsed contents of the stomach disgorged through the mouth or nose that happens as a result of a vomit reflex." ;
    :has_exact_synonym "vomitus" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:amniotic_fluid rdfs:subClassOf :organism_substance ;
    :has_definition "Amniotic fluid is a bodily fluid consisting of watery liquid surrounding and cushioning a growing fetus within the amnion. It allows the fetus to move freely without the walls of the uterus being too tight against its body. Buoyancy is also provided. The composition of the fluid changes over the course of gestation. Initially, amniotic fluid is similar to maternal plasma, mainly water with electrolytes. As the fetus develops, proteins, carbohydrates, lipids, phospholipids originating from the lungs, fetal cells, and urea are deposited in the fluid." ;
    :has_related_synonym "acqua amnii",
        "liquor amnii" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:excreta rdfs:subClassOf :organism_substance ;
    :has_definition "A portion of organism substance that is the product of an excretion process that will be eliminated from the body. An excretion process is elimination by an organism of the waste products that arise as a result of metabolic activity." ;
    :has_exact_synonym "excreted substance",
        "portion of excreted substance",
        "waste substance" ;
    :has_related_synonym "excretion" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pleural_effusion rdfs:subClassOf :pleural_fluid ;
    :has_definition "Pleural effusion is a bodily fluid that is produced in exess and accumulates in the pleural cavity, the fluid-filled space that surrounds the lungs. Excessive amounts of such fluid can impair breathing by limiting the expansion of the lungs during inhalation." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oronasal_secretion rdfs:subClassOf :organism_substance ;
    :has_definition "A bodily fluid secreted from the body via the mouth or nose." ;
    :has_narrow_synonym "oronasal discharge" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pus rdfs:subClassOf :organism_substance ;
    :has_definition "Pus is a bodily fluid consisting of a whitish-yellow or yellow substance produced during inflammatory responses of the body that can be found in regions of pyogenic bacterial infections. Pus is produced from the dead and living cells which travel into the intercellular spaces around the affected cells." ;
    :has_related_synonym "purulent exudate" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blood rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :immediate_transformation_of ;
            owl:someValuesFrom :presumptive_blood ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :presumptive_blood ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :blood_plasma ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :hematopoietic_system ],
        :haemolymphatic_fluid ;
    :has_definition "A fluid that is composed of blood plasma and erythrocytes." ;
    :has_exact_synonym "portion of blood",
        "vertebrate blood" ;
    :has_related_synonym "whole blood" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:haemolymphatic_fluid rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :hemolymphoid_system ],
        :bodily_fluid ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :organism_substance ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :hemolymphoid_system ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Circulating fluid that is part of the hemolymphoid system. Blood, lymph, interstitial fluid or its analogs." ;
    :has_related_synonym "blood or blood analog",
        "circulating fluid" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blastula rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :cleaving_embryo ],
        :embryo ;
    :has_definition "Organism at the blastula stage - an early stage of embryonic development in animals. It is produced by cleavage of a fertilized ovum and consists of a spherical layer of around 128 cells surrounding a central fluid-filled cavity called the blastocoel. The blastula follows the morula and precedes the gastrula in the developmental sequence." ;
    :has_exact_synonym "blastula embryo" ;
    :has_related_synonym "blastosphere" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:late_embryo rdfs:subClassOf :embryo ;
    :has_definition "An embryo that is at the late embryonic stage; this stage covers late steps of the embryogenesis with a fully formed embryo still developing before birth or egg hatching." ;
    :has_narrow_synonym "fetus" ;
    :has_related_synonym "embryo late growth stage",
        "embryo late stage" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gut_wall rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :digestive_tract ],
        :anatomical_wall ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :anatomical_wall ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :digestive_tract ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "The wall of the digestive tract. This encompasses all parts of the digestive tract with the exception of the lumen (cavity)." ;
    :has_exact_synonym "digestive tract wall",
        "wall of digestive tract",
        "wall of gut" ;
    :has_related_synonym "wall of alimentary tract" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucosa rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :epithelium ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :connective_tissue ],
        :organ_component_layer ;
    :has_definition "A lining of mostly endodermal origin, covered in epithelium, which is involved in absorption and secretion. They line various body cavities that are exposed to the external environment and internal organs. It is at several places continuous with skin: at the nostrils, the lips, the ears, the genital area, and the anus. The sticky, thick fluid secreted by the mucous membranes and gland is termed mucus. The term mucous membrane refers to where they are found in the body and not every mucous membrane secretes mucus[WP]." ;
    :has_exact_synonym "mucosa of organ",
        "mucosa of organ part",
        "mucosal region",
        "mucous membrane",
        "organ mucosa" ;
    :has_related_synonym "region of mucosa",
        "tunica mucosa" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:limbic_system rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :forebrain ],
        :ectoderm_derived_structure,
        :organ_system_subdivision ;
    :has_definition "A set of midline structures surrounding the brainstem of the mammalian brain, originally described anatomically, e.g., hippocampal formation, amygdala, hypothalamus, cingulate cortex. Although the original designation was anatomical, the limbic system has come to be associated with the system in the brain subserving emotional functions. As such, it is very poorly defined and doesn't correspond closely to the anatomical meaning any longer. [BirnLex]." ;
    :has_related_synonym "visceral brain" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:musculature_of_body rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :musculature ],
        :caro_0000000,
        :organ_system_subdivision ;
    :has_definition "The subdivision of the musculoskeletal system that consists of all the muscles of the body[VSAO, modified]." ;
    :has_exact_synonym "muscle system",
        "muscle system of body",
        "muscular system",
        "musculature system",
        "set of all muscles",
        "set of muscles of body",
        "vertebrate muscular system" ;
    :has_related_synonym "muskelsystem" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:secretion_of_exocrine_gland rdfs:subClassOf :organism_substance ;
    :has_broad_synonym "secretion" ;
    :has_definition "A portion of organism substance that is produced by exocrine glands." ;
    :has_exact_synonym "bodily secretion",
        "exocrine gland fluid/secretion",
        "secreted substance" ;
    :has_related_synonym "exocrine gland fluid",
        "exocrine gland fluid or secretion",
        "exocrine gland secretion",
        "external secretion" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:organism_substance rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :multicellular_organism ],
        :material_anatomical_entity ;
    :has_definition "Material anatomical entity in a gaseous, liquid, semisolid or solid state; produced by anatomical structures or derived from inhaled and ingested substances that have been modified by anatomical structures as they pass through the body." ;
    :has_exact_synonym "body fluid or substance",
        "body substance",
        "organism substance",
        "portion of body substance",
        "portion of organism substance" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anatomical_space rdfs:subClassOf :immaterial_anatomical_entity ;
    :has_broad_synonym "lumen",
        "space" ;
    :has_definition "Non-material anatomical entity of three dimensions, that is generated by morphogenetic or other physiologic processes; is surrounded by one or more anatomical structures; contains one or more organism substances or anatomical structures." ;
    :has_exact_synonym "lumen space" ;
    :has_related_synonym "anatomical spaces" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:material_anatomical_entity rdfs:subClassOf :anatomical_entity,
        :material_entity ;
    owl:disjointWith :immaterial_anatomical_entity ;
    :has_definition "Anatomical entity that has mass." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:immaterial_anatomical_entity rdfs:subClassOf :anatomical_entity ;
    :has_definition "Anatomical entity that has no mass." ;
    :has_exact_synonym "immaterial physical anatomical entity" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anatomical_system rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :organ ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :multicellular_organism ],
        :anatomical_structure ;
    :has_broad_synonym "system" ;
    :has_definition "Multicellular, connected anatomical structure that has multiple organs as parts and whose parts work together to achieve some shared function." ;
    :has_exact_synonym "body system",
        "connected anatomical system",
        "organ system" ;
    :has_related_synonym "anatomical systems" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multicellular_organism rdfs:subClassOf :multicellular_anatomical_structure ;
    :has_broad_synonym "organism" ;
    :has_definition "Anatomical structure that is an individual member of a species and consists of more than one cell." ;
    :has_exact_synonym "multi-cellular organism" ;
    :has_related_synonym "Koerper",
        "body",
        "whole body",
        "whole organism" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:organism_subdivision rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :multicellular_organism ],
        :multicellular_anatomical_structure ;
    :has_definition "Anatomical structure which is a subdivision of a whole organism, consisting of components of multiple anatomical systems, largely surrounded by a contiguous region of integument." ;
    :has_exact_synonym "anatomic region" ;
    :has_related_synonym "body part",
        "body region",
        "cardinal body part" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:acellular_anatomical_structure rdfs:subClassOf :anatomical_structure ;
    owl:disjointWith :multicellular_anatomical_structure ;
    :has_definition "Anatomical structure that consists of cell parts and cell substances and together does not constitute a cell or a tissue." ;
    :has_related_synonym "acellular anatomical structures" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anatomical_cluster rdfs:subClassOf :disconnected_anatomical_group ;
    :has_definition "Anatomical group that has its parts adjacent to one another." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:extraembryonic_structure rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :entire_extraembryonic_component ],
        :developing_anatomical_structure ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :developing_anatomical_structure ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :entire_extraembryonic_component ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A multicellular anatomical structure that is associated with an embryo and derived from the zygote from which it develops, but which does not contribute to the embryo proper or to structures that are part of the same organism after embryogenesis." ;
    :has_exact_synonym "extra-embryonic structure" ;
    :has_related_synonym "extraembryonic structures",
        "extraembryonic tissue" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:tissue rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :multicellular_organism ],
        :multicellular_anatomical_structure ;
    :has_definition "Multicellular anatomical structure that consists of many cells of one or a few types, arranged in an extracellular matrix such that their long-range organisation is at least partly a repetition of their short-range organisation." ;
    :has_exact_synonym "portion of tissue",
        "tissue portion" ;
    :has_narrow_synonym "simple tissue" .
